<html xmlns:wicket="http://wicket.apache.org/">
<body>
<wicket:panel>
  <div wicket:id="services">
    <div class="header" wicket:id="service" />
    <br>
    <div class="table-display">
      <div class="table-cell" wicket:id="versions">
        <div class="link-bordered">
          <a wicket:id="link" class="external icon link">
            <span  wicket:id="version"></span>
          </a>
        </div>
        <div class="spacer"></div>
      </div>
    </div>
  </div>
</wicket:panel>
</body>
</html>
